content:
@Dikke-deur
Vraag je voor de grap eens af waarom de vluchtelingen deze kant op komen, ipv waarom Nederlanders niet massaal deze gemaskeerde dictatuur ontvluchten.
Misschien kan je op een van die achtergelaten bootjes aan de zuid europese kust naar Afrika vluchten. In je eentje.

@fikkieblijf, ik geloof dat hij ook maar 1 x die 2 uur heeft bijgewoond en daarna hem werd verteld dat het niet meer nodig was.
Ik begrijp de achterliggende gedachten achter deze "cursussen", maar het uitkeringsvolk (lees: voornamelijk migranten) dat toch niet van plan is om te werken zitten er als zoutzakken bij en boeit t toch niets en de 50+ mensen die graag willen werken en alles al weten zijn vaak overkwalificeerd en doen dit omdat ze anders worden gekort op hun tijdelijke uitkering terwijl ze al deels van hun spaargeld moeten leven.
Nederland is ziek.

@Roadblock | 13-02-19 | 14:59: 
"Oh, hij heeft natuurlijk gelijk, maar hij krijgt het niet"
En dat is zo'n beetje de samenvatting van de hedendaagse politiek

@Ongebluste 16:35
Kansloze uitvreters met een kwaadaardige religie is natuurlijk een veel te makkelijke generalisatie.
Een groot deel van de Afrikanen is helegaar niet van het islamitische maar "gewoon" van het materialistische geloof.

@Meeroever: Maak alsjeblieft niet de fout te denken dat koolhydraten 'slechter' zijn dan vetten of eiwitten. Er zijn bijvoorbeeld primitief-levende volksstammen op Aarde die relatief gezien twee tot drie keer zoveel koolhydraten eten als wij (van het zetmeeltype dus, niet van het onverteerbare vezeltype); en die zijn van nature absoluut niet dik of zwaarlijvig. En zo zijn er nog wel een paar zwaarwegende (haha) redenen om aan te voeren dat koolhydratenangst tamelijk misplaatst is; en zelfs ongezond, omdat je met overdreven koolhydratenangst jezelf allerlei nuttige vitaminen, mineralen en ballaststoffen ontzegt. Niet bepaald slim, medunkt.

En alhoewel je van puur vet inderdaad snel een vol gevoel krijgthet is zelfs smerigeet je met deze pizza nu juist *geen* puur vet. (Ik ben me bewust van het feit dat het hier om olie gaat, btw; het principe blijft echter staan.) Je eet zoutig & gekruid & licht zoetig (amylase in je speeksel!) vet. Die smaakmakers maken dat het vet stukken makkelijker naar binnen gaat, en dán gaat het opeens erg hard met die 9 kcal per gram. Mij hoor je niet zeggen dat vetten koste wat het kost vermeden moeten worden (het is net zo dom als koolhydratenangst), maar de hoeveelheid die over deze pizza's ging, is echt een flinke hap uit je dagelijkse behoefte, en daar mag je je als eter wel degelijk bewust van zijn.

Awel, morgen pasta all'uovo voor mij. Uiteraard zelfgemaakt, met zelfgemaakte vlees-groetensaus, en daarbij knapperige salade met frisse sinaasappeldressing. Smakelijk!

@Eeuwig
Allereerst wil ik u bedanken voor "hup, Mohammed heeft zin vanavond" wat mij zeker 10 minuten aan het lachen heeft gehouden.
Ten tweede spreekt u wijze woorden. Dat Nederlandse deugers zich niet kunnen voorstellen dat je je kinderen als lokaas en reddingsboei gebruikt betekent niet dat het onder immigranten geen schering en inslag is.
@Kleurling
Wij, Nederlanders, moeten, indachtig de woorden van EOV, ervan uitgaan dat het zwartste scenario m.b.t. de rol van de kinderen bij immigranten uit achterlijke landen de werkelijkheid is. Ouders zullen die kinderen voor van alles en nog wat misbruiken om binnen te komen.

@gato | 13-12-18 | 10:08 |
En wat dacht u net van het bericht op het radionieuws over de moslim extremist - ja ja, een pleonasme, ik weet het - die de Kerstmarkt in Straatsburg overhoop schoot? Er werd gesproken over een "levensgevaarlijke man" en een nog "voortvluchtige schutter". Nergens, maar dan ook echt nergens werd de islam, of het waaróm van zijn daad benoemd. Want het klootjesvolk mocht eens wakker worden en gaan beseffen dat die 'verrijking' helemaal niet zo verrijkend is. In de Teleblah vanmorgen al de Stelling v/d Dag waarin geopperd werd dat we vanwege de veiligheid dan de Kerstmarkten misschien maar moeten gaan opdoeken. Of Kerst maar niet meer zo uitbundig vieren om te voorkomen dat we onbedoeld op meterslange islamtenen gaan staan.
@Mammeloe
Ja, die loopt nog vrij rond. Zal wel ergens in de Oemma ondergedoken zitten ondertussen. Net als die Abdelhatseflats toen na de aanslag op Zaventem. Kwam pas na 4 - 5 maanden bovendrijven. Had al die tijd gewoon prinsheerlijk vrijelijk geleefd in de Brusselse Banlieus.

