@ballenvanstijl.
1: ze zet niemand voor lul
2: blijven lachen op die manier is een nonchalance van ongekende hoogte en 5: ik kan niet tellen

Mijnheer Jetten is een typische D66-er: Hypocriet en anderen de maat nemen die niet hun 'superieure' gedachtengoed onderschrijven, maar zelf erop los leven. Het superieure gedachtengoed is alleen voor het plebs (zoals uw toegenegen Ballenkraker) Mijnheer Pechtold was in mijn ogen een hypocriete charlatan. Mijnheer Jetten overtreft zelfs mijnheer Pechtold. Ik dacht werkelijk dat het niet erger kon dan mijnheer Pechtold. 
Laten we hopen dat de Nederlandse kiezer deze 'zoon' van mevrouw Ollongren (nomen est omen als je haar naam uit het Zweeds vertaalt) snel ontmaskert. Als mevrouw Ollongren (waar ik me als halve Zweed heel erg voor schaam) het touwtje gaat overnemen van mijnheer Jetten, dan zal die halve Zweedse feeks hopelijk snel weggestemd worden want haar vind ik eigenlijk nog gevaarlijker dan het robotje. 
Ik begin steeds meer te denken dat enkel massaal stemmen op Geert Wilders Nederland nog kan redden van de volgende grootste problemen waar we tegen moeten worstelen:
- massale import van moslims uit het Midden Oosten en Afrika;
- het achterlijke klimaatbeleid;
- verdere islamisering van het land.
Noodzakelijke maatregelen die genomen moeten worden:
- goed en toegankelijk onderwijs voor iedereen met een Nederlands paspoort en legaal ingezetene;
- stop immigratie uit Afrika en midden Oosten van moslims (bedreigde christenen, heidenen, homo's zijn welkom);
- investeer in het onderwijs op alle lagen (laag - hoog), zodat Nederland een kenniseconomie wordt (kap ook met het leenstelsel voor studenten);
- kappen met voorkeursbeleid bij banen (met name overheden) voor allochtonen (ben er zelf ook een) en vrouwen (gewoon de beste op de plek);
- stimuleer remigratie (Nederland is gewoon vol);
- eerlijke rechtspraak (geen fopstraffen om mensen niet te hoeven uit te zetten);
- geen houders van een dubbele paspoort in een politieke functie;
- uitzetten criminelen naar land van alternatief paspoort indien van toepassing, verklaren tot persona non grata;
- goed de grenzen controleren, de EU vervangen tot een verdrag zonder schurkenstaten uit de Balkan.
Maar goed, ik ben geen minister president en zal het ook worden.
Uw toegenegen,

Waarom zou de regering er wat aan doen?
Laat die domme, blanke Nederlanders toch gewoon werken, want anders zijn ze als ‘melkkoe’ niet bruikbaar.
Immers, buitenlanders maken hier de dienst uit!
Voor mensen zoals ik die in de jaren ‘80 al in de achterstandwijken van Amsterdam, Den Haag en Rotterdam werkten, wisten toen al dat er massaal door allochtonen werd gefraudeerd:
- kinderbijslag claimen voor kinderen die niet bestonden (opgegeven werd dat deze kinderen in Marokko en Turkije waren achtergebleven);
- op papier gescheiden maar feitelijk bij elkaar wonen en zich als man en vrouw gedragen om zo een hogere uitkering te krijgen en dubbele toeslagen;
- uitkering trekken en ‘s-nachts om 04:00 uur op het Hobbemaplein in Den Haag in een busje stappen om illegaal in de tuinbouw in het Westland te gaan werken;
- WAO-uitkering opstrijken en in Turkije en Marokko verblijven en werken, maar vooral niet meewerken aan een herkeuring om zo de uitkering te behouden, naast hun inkomen uit werk in Marokko of Turkije;
- belastingfraude;
- verzekeringsfraude;
- enz, enz.
Dus 2011 was al te laat, maar 2019 is veels te laat. Maar dat heb je met kamerleden die niet in onze maatschappij staan en alle signalen negeren. Maar wel klagen dat het populisme toeneemt?! Mafkezen zijn het.
Ik kijk uit naar de aankomende verkiezingen! Ik ga stemmen en hoe...

